script: |
  super -f text -I q5788.spq | sort > q5788.out

inputs:
  - name: q5788.spq
    data: |
      SELECT DISTINCT + col2 FROM tab0 (FORMAT parquet) WHERE NOT - ( - col0 ) + + 19 IN ( - col2 * - 42 + + col1, - 81, - col1 * - - col2 );
  - name: tab0

outputs:
  - name: q5788.out
    data: |
      10
      47
      99
